import React from 'react';
import { FormGroup, Label, Input } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.css';

export default class IdPsp extends React.Component {
	constructor() {
		super();
		this.state = { email: '', invalidEmail: false };
	}

	render() {
		return (
			<div>
				<Label style={{ color: 'grey' }}>Identifiant(PSP)</Label>
				<Input
					type="text"
					name="PaiementNumber"
					id="PaiementNumber"
					maxLength="10"
					required
					value={this.props.idPsp}
				/>
				<FormGroup />
			</div>
		);
	}
}
